const intialState = {
	branding: {
		title: LocalStorage.getFromLocalStorage(
			StorageKeys.BRAND_TITLE,
			'The Challenger'
		),
		description: LocalStorage.getFromLocalStorage(
			StorageKeys.BRAND_DESCRIPTION,
			''
		),
		logosmall: LocalStorage.getFromLocalStorage(
			StorageKeys.BRAND_LOGO_SMALL,
			defaultImage
		),
		logolarge: LocalStorage.getFromLocalStorage(
			StorageKeys.BRAND_LOGO_LARGE,
			defaultImage
		),
	},
};

export const brandingReducer = (state = intialState, action) => {
	switch (action.type) {
		case ActionTypes.BRANDING_UPDATED:
			LocalStorage.saveInLocalStorage(
				StorageKeys.BRAND_TITLE,
				action.branding.title
			);
			LocalStorage.saveInLocalStorage(
				StorageKeys.BRAND_DESCRIPTION,
				action.branding.description
			);
			LocalStorage.saveInLocalStorage(
				StorageKeys.BRAND_LOGO_SMALL,
				action.branding.smalllogo
			);
			LocalStorage.saveInLocalStorage(
				StorageKeys.BRAND_LOGO_LARGE,
				action.branding.largelogo
			);
			return Object.assign({}, state, {
				user: {
					...state.branding,
					...action.branding,
				},
			});
		default:
			return state;
	}
};
